import React from 'react'
import Hero from './Hero';
import Service from './Service';
import Testimonial from './Testimonial';
import HowWeWork from './Workflow';
import "style.css"
import 'animate.css';



function Services() {
  return (
    <div className='ml-6'>
        {/* <Hero/> */}
        <Service/>
        <HowWeWork/>
        <Testimonial/>
    </div>
  )
}

export default Services
